import axios from '../axios';

const handleGetAllProducts = async (inputId) => {
    return await axios.get(`/api/get-all-product?id=${inputId}`);
};

const handleGetAllCodeService = async () => {
    return await axios.get(`/api/all-code`);
}



export { handleGetAllProducts, handleGetAllCodeService }
